import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import Particles from "react-tsparticles";
import './App.css';
import { Component } from 'react';
import { loadFull } from 'tsparticles';

const particlesOptions = {
  background: {
      color: {
          value: "none",
      },
  },
  fpsLimit: 120,
  interactivity: {
      events: {
          onClick: {
              enable: true,
              mode: "push",
          },
          onHover: {
              enable: true,
              mode: "repulse",
          },
          resize: true,
      },
      modes: {
          bubble:{
            distance: 400,
            duration: 2,
            opacity: 0.8,
            size: 40
          },
          push: {
              quantity: 4,
          },
          repulse: {
              distance: 200,
              duration: 0.4,
          },
      },
  },
  particles: {
      color: {
          value: "#ffffff",
      },
      links: {
          color: "#ffffff",
          distance: 150,
          enable: true,
          opacity: 0.5,
          width: 1,
      },
      collisions: {
          enable: true,
      },
      move: {
          directions: "none",
          enable: true,
          outModes: {
              default: "bounce",
          },
          random: false,
          speed: 6,
          straight: false,
      },
      number: {
          density: {
              enable: true,
              area: 800,
          },
          value: 80,
      },
      opacity: {
          value: 0.5,
      },
      shape: {
          type: "circle",
      },
      size: {
          value: { random: true, value:5 },
      },
  },
  detectRetina: true,
};

class App extends Component {
  constructor(){
    super();
    this.state ={
      input: '',


    }

  }

  onInputChange = (event) =>{
    console.log(event.target.value);
  }


  particlesInit =  async engine =>{
    await loadFull(engine);
  }

  particlesLoaded = async container =>{
  await console.log(container);
  };


  render() {
    return(
    <div className="App">
       <Particles
            id="tsparticles"
            init={this.particlesInit}
            loaded={this.particlesLoaded}
            options={particlesOptions}
        />
      <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange}/>
         {/*
        <FaceRecognition />
         */
      }
    </div>
  )};
}

export default App;
